import React from 'react';
import { Skeleton } from '@mui/material';

function getRandomNum(min, max) {
	return Math.floor(Math.random() * (max - min + 1)) + min;
}

const randomNumber = getRandomNum(4, 8);
let skeletons = [];

for (let i = 1; i <= randomNumber; i++) {
	skeletons.push(i);
}

function Loading() {
	return (
		<>
			{skeletons.map((s) => {
				return (
					<Skeleton
						variant='rectangular'
						height={40}
						width={150}
						style={{
							marginBottom: '5px',
							borderRadius: '20px',
							display: 'inline-block',
							marginRight: '5px',
						}}
					/>
				);
			})}
		</>
	);
}

export default Loading;
